import React from 'react';
import './App.css';
import Logo from './loyolaPicture.png'
import { Link } from 'react-router-dom';




export class App extends React.Component{
  render(){
    return(
      <div>

        <div className = 'mainHeader'>
          <img id = 'loyolaLogo' src = {Logo} alt='Loyola Logo' />
          <h1 className= 'siteTitle'> LUC Course Evaluation Web-App </h1>
          <div id = 'middleLine'></div>
          <div className= "courseHead"><Link to='#'>Courses</Link></div>
          <div className="profHead">Professors</div>
          <div className="contactHead">Contact</div>
        </div>




      </div>











    )
  }
}
